Template.bumped.helpers({

  nameOfFriend() {
    let needName = this.needName;

    let notification =  this.notification_log.find(function (x) {
      return (x.needName === needName) && (x.uid !== Meteor.userId()) ;
    });

    let user = this.users.find(function(x){
      return x._id === notification.uid;
    });
    return user.username;
  },
  friendInfo(){
    let needName = this.needName;

    let notification =  this.notification_log.find(function (x) {
      return (x.needName === needName) && (x.uid !== Meteor.userId()) ;
    });

    let user = this.users.find(function(x){
      return x._id === notification.uid;
    });
    let friendName =  user.username;

    return {key: 'nameOfFriend', value: friendName};
  }
});

Template.halfhalfPhoto.helpers({
  isNull(obj) {
    return obj == null;
  },
  getName(x){
    return x.friendName;
  },
  getImage(x){
    return x.image;
  },
  getMyImage(x){
    return x.myImage;
  },
  bumpees() {
    // copied from bumpedResults template helper in api_custom_results.js
    // TODO: if a total copy, maybe reuse this helper function in both places instead of copying code
    // TODO: WILL THIS BREAK IF NO SUBMISSIONS EXIST?
    let mySubs = this.submissions.filter(function(x){
      return x.uid === Meteor.userId();
    });

    let myNeedNames = mySubs.map(function(x){
      return x.needName;
    });

    let otherSubs = this.submissions.filter(function(x){
      return (myNeedNames.includes(x.needName)) && (x.uid !== Meteor.userId());
    });

    let contents = otherSubs.map(function(x){
      let myInfoDic = mySubs.find(function(y){
        return y.needName === x.needName;
      });
      return {image: x.content.proof, friendName: myInfoDic.content.nameOfFriend, myImage: myInfoDic.content.proof};
    });

    console.log("contents", contents);

    let images = this.images;
    contents.reverse();

    contents = contents.map(function(x){
      let img = images.find(function(y){
        return y._id === x.image;
      });
      let myImg = images.find(function(y){
        return y._id === x.myImage;
      });

      return {friendName: x.friendName,image: img, myImage: myImg};
    });

    console.log("contents2", contents);
    return contents;
  }
});

Template.halfhalfPhoto.events({
  'click #testPhoto'() {
    let sampleImgSrc = " data:image/png;base64,";
    $('.fileinput-preview').attr('src', sampleImgSrc);
    $('.fileinput-preview').show();
  },
  'click #startCamera'() {
    let cameraOverlay = document.getElementById('cameraOverlay');
    let rect = cameraOverlay.getBoundingClientRect();
    CameraPreview.startCamera({
      x: rect.left, y: rect.top, width: rect.width, height: rect.height, camera: "front",
      tapPhoto: true, previewDrag: false, toBack: true});
    CameraPreview.show();
    $('.fileinput-preview').hide();
    document.getElementById('takeHalfHalfPhoto').style.display = "inline";
    document.getElementById('switchCamera').style.display = "inline";
    document.getElementById('startCamera').style.display = "none";
  },
  'click #takeHalfHalfPhoto'(event,target) {
    CameraPreview.takePicture(function(imgData){
      let rect;
      // first one to take picture, so the left half of image will be cropped and used
      if (this.image == null) {
        let cameraOverlay = document.getElementById('leftHalf');
        rect = cameraOverlay.getBoundingClientRect();
      }
      // second one to take picture, so the right half of image will be cropped and used
      else {
        let cameraOverlay = document.getElementById('leftHalf');
        rect = cameraOverlay.getBoundingClientRect();
      }
      b64Crop(imgData, rect.width, rect.height, rect.x, rect.y, function(croppedImg) {
        $('.fileinput-preview').attr('src', 'data:image/jpeg;base64,' + croppedImg);
        CameraPreview.hide();
        $('.fileinput-preview').show();
        document.getElementById('retakePhoto').style.display = "inline";
        document.getElementById('takeHalfHalfPhoto').style.display = "none";
        document.getElementById('switchCamera').style.display = "none";
      });
    });
  },
  'click #retakePhoto'(event, target) {
    CameraPreview.show();
    $('.fileinput-preview').hide();
    document.getElementById('retakePhoto').style.display = "none";
    document.getElementById('takeHalfHalfPhoto').style.display = "inline";
    document.getElementById('switchCamera').style.display = "inline";
  },
  'click #switchCamera'() {
    CameraPreview.switchCamera();
  }
});

/**
 * Convert a base64 string in a Blob according to the data and contentType.
 *
 * @param b64Data {String} Pure base64 string without contentType
 * @param contentType {String} the content type of the file i.e (image/jpeg - image/png - text/plain)
 * @param sliceSize {Int} SliceSize to process the byteCharacters
 * @see http://stackoverflow.com/questions/16245767/creating-a-blob-from-a-base64-string-in-javascript
 * @return Blob
 */
function b64toBlob(b64Data, contentType, sliceSize) {
  contentType = contentType || '';
  sliceSize = sliceSize || 512;

  let byteCharacters = atob(b64Data);
  let byteArrays = [];

  for (let offset = 0; offset < byteCharacters.length; offset += sliceSize) {
    let slice = byteCharacters.slice(offset, offset + sliceSize);

    let byteNumbers = new Array(slice.length);
    for (let i = 0; i < slice.length; i++) {
      byteNumbers[i] = slice.charCodeAt(i);
    }

    let byteArray = new Uint8Array(byteNumbers);

    byteArrays.push(byteArray);
  }

  return new Blob(byteArrays, {type: contentType});
}

function b64Crop(base64PictureData, rect_width, rect_height, x_coord, y_coord, callback) {

  // image will contain ORIGINAL image
  let image = new Image();

  // image will contain CROPPED image
  let canvas = document.createElement('canvas');
  let ctx = canvas.getContext('2d');

  // Load original image into image element
  image.src = 'data:image/jpeg;base64,' + base64PictureData;
  image.onload = function(){

    // Required to interpolate rectangle(from screen) into original image
    let x_axis_scale = image.width / window.screen.width
    let y_axis_scale = image.height / window.screen.height

    // INTERPOLATE
    let x_coord_int = x_coord * x_axis_scale;
    let y_coord_int = y_coord * y_axis_scale;
    let rect_width_int = rect_width * x_axis_scale;
    let rect_height_int = rect_height * y_axis_scale

    // Set canvas size equivalent to interpolated rectangle size
    canvas.width = rect_width_int;
    canvas.height = rect_height_int;

    ctx.drawImage(image,
      x_coord_int, y_coord_int,           // Start CROPPING from x_coord(interpolated) and y_coord(interpolated)
      rect_width_int, rect_height_int,    // Crop interpolated rectangle
      0, 0,                               // Place the result at 0, 0 in the canvas,
      rect_width_int, rect_height_int);   // Crop interpolated rectangle

    // Get base64 representation of cropped image
    let cropped_img_base64 = canvas.toDataURL();

    // Now we are ready to send cropped image TO SERVER
    callback(cropped_img_base64);

    return cropped_img_base64;
  };
};



